//index.js
import React from 'react';
import ReactDOM from 'react-dom';

const  project= " Calculator";

ReactDOM.render(
<>
<h1> **Project Name: { project}** </h1>
<ul>
<li> Addition:  {5+5}  </li>
<li> Subtraction:   {15-5}  </li>
<li> Multiplication:    {5*5}  </li>
<li> Division:   {10/2} </li>
<li> Luky No:   {Math.random()} </li>
</ul>
</> , document.getElementById("root"));
